  false,\n\t\"url\": null,\n\t\"notes\": \"As a guide to newcomers and visitors, fishery
  biologists have compiled a list of some of the well-known fishing waters in Alaska.
  The list is merely a starting point and makes no pretense at completeness. It will,
  however, serve to point out a number of the fishing spots, the important sport fish
  there and a guide to facilities available. With a little experience the new angler
  will seek out his own fishing spot, not to be found in this brief list. For convenience,
  fishing waters are tabulated for Southeastern Alaska, Anchorage - Kenai Region,
  Kodiak, Alaska Peninsula and Northern Alaska.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
